import React from "react";
import "./css/Copyright.css";

function Copyright() {
  let year = new Date();
  year = year.getFullYear();
  return (
    <div className="copyright">
      Copyright &copy; {year} FAM Engineering and Family
    </div>
  );
}

export default Copyright;
